void serial_init(serial_t* obj, PinName tx, PinName rx)
{
  UNITY_LINE_TYPE cmock_line = TEST_LINE_NUM;
  CMOCK_serial_init_CALL_INSTANCE* cmock_call_instance;
  UNITY_SET_DETAIL(CMockString_serial_init);
  cmock_call_instance = (CMOCK_serial_init_CALL_INSTANCE*)CMock_Guts_GetAddressFor(Mock.serial_init_CallInstance);
  Mock.serial_init_CallInstance = CMock_Guts_MemNext(Mock.serial_init_CallInstance);
  if (Mock.serial_init_IgnoreBool)
  {
    UNITY_CLR_DETAILS();
    return;
  }
  UNITY_TEST_ASSERT_NOT_NULL(cmock_call_instance, cmock_line, CMockStringCalledMore);
  cmock_line = cmock_call_instance->LineNumber;
  if (!cmock_call_instance->ExpectAnyArgsBool)
  {
  if (!cmock_call_instance->IgnoreArg_obj)
  {
    UNITY_SET_DETAILS(CMockString_serial_init,CMockString_obj);
    if (cmock_call_instance->Expected_obj == NULL)
      { UNITY_TEST_ASSERT_NULL(obj, cmock_line, CMockStringExpNULL); }
    else
      { UNITY_TEST_ASSERT_EQUAL_MEMORY_ARRAY((void*)(cmock_call_instance->Expected_obj), (void*)(obj), sizeof(serial_t), cmock_call_instance->Expected_obj_Depth, cmock_line, CMockStringMismatch); }
  }
  if (!cmock_call_instance->IgnoreArg_tx)
  {
    UNITY_SET_DETAILS(CMockString_serial_init,CMockString_tx);
    UNITY_TEST_ASSERT_EQUAL_MEMORY((void*)(&cmock_call_instance->Expected_tx), (void*)(&tx), sizeof(PinName), cmock_line, CMockStringMismatch);
  }
  if (!cmock_call_instance->IgnoreArg_rx)
  {
    UNITY_SET_DETAILS(CMockString_serial_init,CMockString_rx);
    UNITY_TEST_ASSERT_EQUAL_MEMORY((void*)(&cmock_call_instance->Expected_rx), (void*)(&rx), sizeof(PinName), cmock_line, CMockStringMismatch);
  }
  }
  if (cmock_call_instance->ReturnThruPtr_obj_Used)
  {
    UNITY_TEST_ASSERT_NOT_NULL(obj, cmock_line, CMockStringPtrIsNULL);
    memcpy((void*)obj, (void*)cmock_call_instance->ReturnThruPtr_obj_Val,
      cmock_call_instance->ReturnThruPtr_obj_Size);
  }
  UNITY_CLR_DETAILS();
}

